    private APIServlet servlet;
    
    @Before
    public void setup() throws Exception
    {
        // copy artifacts to temp location
        final File tmpOut = File.createTempFile("unittest", "suffix");
        tmpOut.deleteOnExit();
        try ( InputStream in= getClass().getResourceAsStream("/artifacts.json" ) ) 
        {
            Files.copy( in , tmpOut.toPath(),StandardCopyOption.REPLACE_EXISTING); 
        }
        
        System.setProperty( APIImpl.SYSTEM_PROPERTY_ARTIFACT_FILE , tmpOut.getAbsolutePath() );
        final APIImpl impl = APIImplHolder.getInstance().getImpl();
        servlet = new APIServlet();
    }
    
    public void tearDown() throws Exception 
    {
        APIImplHolder.getInstance().getImpl().close();
    }
    
    @Test
    public void testPerformance() throws Exception 
    {
        for ( int i = 0 ; i < 1 ; i++ ) {
            doTest();
        }
        System.out.println("Press any key");
        BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
        reader.readLine();
        
        final long start = System.currentTimeMillis();
        doTest();
        final long end = System.currentTimeMillis();
        System.out.println("Test: "+(end-start)+" ms");
    }
    
    private void doTest() throws Exception 
    {
        for (int i = 0; i < queries.length; i++) {
            String req = queries[i];
            System.out.println("Query #"+i);
            System.out.println(req);
            servlet.processRequest( req );
        }
    }
